def paul_nation(infile, offset=0, outfile=None):
	with open(infile, 'r',encoding='utf-8') as fp, open(outfile if outfile else infile +".out" , 'w',encoding='utf-8') as fw: 
		words =[ line.strip().lower() for line in fp.readlines() if line]
		rows = [ (w, nyt_wc.get(w, 0)) for w in words ]
		rows.sort(key=lambda a:a[1], reverse=True)
		for i , row in enumerate(rows): fw.write(row[0]+"\t"+ str( offset +  round( i/1000, 3 )) + "\n")
	print("finished:", infile)

